package Practice;

public class Multiple {
	static void multiple(int first, int second)
	{
		System.out.println("Enter two numbers: " + first + " x " + second + " = " + (first*second));
	}
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int first = 100;
		int second = 200;
		multiple(first, second);
	}

}
